  in the Martha's Vineyard Coastal Observatory (MVCO) in the northwest Atlantic in
  coastal waters of North America.  Extensive, detailed documentation is available
  in these .xml files:nhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/MVCO_ObservingSystem.xmlnhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/ADCP_System.xmlnhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/MVCO_Workhorse_1200.xmlnhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/RDI_Workhorse_1200.xmlnhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/Pressure_Obs_Process.xmlnhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/Velocity_Obs_Process.xmlnhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/Pressure_QC_Chain.xmlnhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/Velocity_QC_Chain.xmlnhttp://mvcodata.whoi.edu/downloads/sensorML/v1.0/examples/sensors/ADCP_2.2/PUV_Analysis.xmlnnFor
